const Formulario = () => {
    return(
        <Fragment>
            <h2>Crear Cita</h2>
            <form>
                <label>Paciente</label>
                <input
                    type="text"
                    name="paciente"
                    className="u-full-width"
                    placeholder="Nombre Paciente"

                />

            </form>



        </Fragment>
    );
}


export default Formulario;
